    <span className='entry'>
        <Link style={{ textDecoration: 'none', color: 'inherit' }} to="/FullAnalysis" state={{content: dr.dreamContent, genre: dr.dreamGenre, analysis: dr.dreamAnalysis, title: dr.dreamTitle, image: dr.dreamImage}}>
