        </Link>
        <p id='desc1'>Genre: {dr.dreamGenre} </p>
        <p id='desc1'>{dr.dreamContent} </p>
    </span>

    );
  return (
    <div className='contents'>
    <HeaderAndNavBar />
    {dreamEntries}
    </div>
  );
}

export default Dreams;
